    false,nt"url": null,nt"notes": "Summary report of the 1991 duck nest survey
    at Ouray National Wildlife Refuge.  Key areas of the refuge were nest searched during
    the period between May 25th and July 11th with follow-up nest fate checks during
    the month of August.  Methods of searching included the chain-drag method and walking
    method.  This report includes summary data for overall nest success, species composition,
    predation, cover type, nest success, breeding duck pair counts, and duck production
    at Ouray National Wildlife Refuge.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
